/*!------------------------------------------------
@brief      デフォルトコンストラクタ
@note       クラスを構築する
@attention  なし
--------------------------------------------------*/
MnistMain::MnistMain() : argc_(0), argv_(0x00), oneHotLabel_(true), normalize_(true), flatten_(true), accuracyCount_(0) {
}

/*!------------------------------------------------
@brief      コンストラクタ
@note       クラスを構築する
@attention  なし
--------------------------------------------------*/
MnistMain::MnistMain(int argc, char** argv) : argc_(argc), argv_(argv), oneHotLabel_(true), normalize_(true), flatten_(true), accuracyCount_(0) {
}

/*!------------------------------------------------
@brief      デフォルトデストラクタ
@note       クラスを破棄する
@attention  なし
--------------------------------------------------*/
MnistMain::~MnistMain() {
}

/*!------------------------------------------------
@brief      処理を開始する
@note       処理を開始する
@return     なし
@attention  なし
--------------------------------------------------*/
int MnistMain::run() {
	initialize();

	std::cout << "Result" << std::endl;
	std::cout << getMiniBatch(images_).rows << std::endl;

	for(int row = 0; row < images_.rows; ++row) {
		predict(row);
	}

	std::cout << "Accuracy = " << (float)accuracyCount_/10000 << std::endl;
	return 0;
}

/*!------------------------------------------------
@brief      
@note       
@param[in]  パラメータ名  説明  [単位] (範囲)
@param[out] 
@return     なし
@attention  なし
--------------------------------------------------*/
void MnistMain::initialize() {
	MnistReaderOpenCV* mnistReader;
	mnistReader = new MnistReaderOpenCV();

	//イメージ数 = 10000
	//イメージサイズ = 28 * 28

	std::string filename = "../dataset/t10k-labels-idx1-ubyte";
	oneHotLabel_ = false;
	labels_ = mnistReader->readMnistLabel(filename, oneHotLabel_);

	//read MNIST iamge into OpenCV Mat vector
	filename = "../dataset/t10k-images-idx3-ubyte";
	images_ = mnistReader->readMnist(filename, normalize_, flatten_);

	delete mnistReader;

	establishNetwork();

}

